import React from "react";
import axios from "axios";
import { toast } from "react-toastify";

export default async function GetUser(id) {
  const linkApi = `api/users/${id}`;
  let user = {};

  // TODO
  axios
    .get(linkApi)
    .then((res) => {
      console.log(res);
      console.log("1");
    })
    .catch((err) => {
      const errMsg = err.response.data.message;
      toast.error(errMsg);
    });

  console.log("2");
  return user;
}
